css:
@-moz-document url-prefix("http://localhost:5000/") {
:root {
    --color-background: #383C4A;
    --color-background-darker: #51576B;
    --color-header-darker: #007BC7;
    --color-headings: #FBFBFB;
    --color-links: #4381EB;
    --color-text: #FBFBFB;
    --color-text-lighter: #D9D9D9;
    --color-text-lightest: #A8A8A8;
    --color-sidebar-background: #383C4A;
    --color-sidebar-text: #D9D9D9;
    --color-sidebar-border: #4F5569;
    --color-table-header-background: #4F5569;
    --color-table-header-text: #D9D9D9;
    --color-table-border: #434859;
}
code {
    --color-code-background: #4B5163;
}
.journal {
    --color-journal-postings: #4B5163;
}
li.balance .bal, li.balance .datecell, li.balance .flag {
    --entry-type-color: #284528;
}
li.document .datecell, li.document .flag {
    --entry-type-color: #4F3E4F;
}
.treemap {
    --color-text-lightest: #383C4A;
}
button {
    --color-background: #FBFBFB;
}
}
